Sfruttando le PCS e le system call si ha come esempio: .data
message: .asciz "hello world\n" .text // Allinea il code segment ad un multiplo di 16 per aumentare le istruzioni
// caricate nella cache line (larga 16 byte), aumentando i cache hit
.p2align 4 .global _start
_start: bl find_message	// Usa il ritorno come argomento (PCS #1) bl print_str mov x0, #0	// Imposta l'argomento (PCS #1) bl exit // Argomenti:
// - (void)
find_message: adr x0, message	// Restituisce x0 (PCS #2) ret // Argomenti:
// - (int) x0
exit: mov x8, #93 svc #0 ret // Argomenti:
// - (char) w0
print_char: str w0, [sp, #-16]!	// Allineato a 16 byte (PCS #8) mov x0, #1 mov x1, sp	// Usa lo stack come indirizzo per la stringa mov x2, #1 mov x8, #64 svc #0	// System call per write(2) add sp, sp, #16	// Ripristina lo stack (PCS #7) ret // Argomenti:
// - (char *) x0
.global print_str	// Rende la funzione visibile a *.o linkando
print_str: ldrb w1, [x0]	// Rimpiazza x1 (PCS #4) cmp w1, #0 b.eq str_empty str lr, [sp, #-16]!	// Salva lr prima del linking (PCS #3) str x0, [sp, #-16]! ldrb w0, [x0]	// Carica un byte dall'indirizzo x0 bl print_char ldr x0, [sp], #16	// Ripristina x0 assumendo modifiche (PCS #4) add x0, x0, #1 bl print_str	// Step della ricorsione ldr lr, [sp], #16	// Ripristina lr e poi sp (PCS #3, #7) ret str_empty: ret

