I dispositivi che comunicano su un bus sincrono dispongono dello stesso clock e lo sfruttano per accordare gli accessi al bus . Questo però è limitato a bus corti , perchè altrimenti il segnale di clock si disallinea. In un bus asincrono invece, ogni dispositivo ha un clock diverso , che permette il trasferimento a lunghe distanze e a velocità diverse (e.g. USB e SATA). Questo richiederà un costo iniziale dato dall' handshake per sincronizzare i due dispositivi, che avviene su due fili aggiuntivi chiamati Req e Ack . La richiesta di invio dati req è impostata dal mittente , mentre la conferma di lettura ack dal destinatario : bool req = 0, ack = 0;
char data[2];	// 16+2 bit di fili condivisi void sender() { update(data); req = 1; while (ack == 0); req = 0;
} void receiver() { while (req == 0); read(data); ack = 1; while (req == 1); ack = 0;
}

