Questa parte non sarà contenuta all'interno dell' ALU ma la sfrutterà per creare l'algoritmo che permette la moltiplicazione tra due numeri. L'algoritmo si basa sul metodo di moltiplicazione in colonna e si può riassumere in: long mul(int a, int b) { unsigned long r0 = abs(a);	// Registro a 64bit perchè r0 << 1 per 32 volte unsigned int r1 = abs(b); long sum = 0; for (size_t i = 0; i < sizeof(a) * 8; i++) { if (r1 & 0x1) { sum += r0;	// Necessaria una ALU da 64bit } r0 <<= 1; r1 >>= 1; } if ((a > 0) ^ (b > 0)) {	// Controllo dei bit di segno sum = -sum; } return sum;	// a * b
} che necessita, però, di una ALU e di un registro a 64bit, motivo per cui è stato ideato un algoritmo alternativo che è anche più ottimizzato : long mul(int a, int b) { unsigned int r1 = abs(b); long sum = 0; for (size_t i = 0; i < sizeof(a) * 8; i++) { if (r1 & 0x1) { unsigned int upper = sum >> (sizeof(sum)*8/2); unsigned int lower = sum & ~0U; upper += abs(a); sum = (long) upper << (sizeof(sum)*8/2) | lower; } r1 >>= 1; sum >>= 1; } if ((a > 0) ^ (b > 0)) { sum = -sum; } return sum;
}
